import styles from "./PublicPost.module.scss";
console.log(styles);
export function PublicPost() {
  const boxPost = [
    { url: "/public/ico/box_post/item_photo.svg", class: styles.postPhoto },
    { url: "/public/ico/box_post/item_video.svg", class: styles.postVideo },
    { url: "/public/ico/box_post/item_audio.svg", class: styles.postAudio },
    { url: "/public/ico/box_post/item_article.svg", class: styles.postArticle },
    { url: "/public/ico/box_post/item_short_video.svg", class: styles.postShort },
    { url: "/public/ico/box_post/item_photo.svg", class: styles.postPhoto },
  ];
  return <div className={`${styles.box_post} boxBorder`}></div>;
}
